import React from "react";
import './navbar.css'
const Sidebar = ({Title}) => {
    return (
      <ul>
       <li><a href="/">{Title}</a></li>
        <li><a href="/index2.js">Tareas</a></li>
        <li><a href="">Calendario</a></li>
         <li><a href="">Cambios</a></li>
      </ul>
        );
  };
  export default Sidebar
